(function (Scratch) {
  'use strict';
  const menuIconURI =
    "data:image/png;base64,"

  const toNum = (v, fallback = 0) => {
    const n = Number(v);
    return Number.isFinite(n) ? n : fallback;
  };
  const isInt = Number.isInteger;

  function xmur3(str) {
    let h = 1779033703 ^ str.length;
    for (let i = 0; i < str.length; i++) {
      h = Math.imul(h ^ str.charCodeAt(i), 3432918353);
      h = (h << 13) | (h >>> 19);
    }
    return function () {
      h = Math.imul(h ^ (h >>> 16), 2246822507);
      h = Math.imul(h ^ (h >>> 13), 3266489909);
      return (h ^= h >>> 16) >>> 0;
    };
  }

  function mulberry32(a) {
    return function () {
      let t = (a += 0x6d2b79f5);
      t = Math.imul(t ^ (t >>> 15), t | 1);
      t ^= t + Math.imul(t ^ (t >>> 7), t | 61);
      return ((t ^ (t >>> 14)) >>> 0) / 4294967296;
    };
  }

  function makeRngFromSeed(seed) {
    const seedStr = String(seed).trim();
    const seedGen = xmur3(seedStr);
    return mulberry32(seedGen());
  }

  class SeededRandomExtension {
    getInfo() {
      return {
        id: 'seededrandom',
        name: 'Seeded RNG',
        unsandboxed: true,
        color1: '#7aba7a',
        color2: '#6aa86a', // slightly darker green
        color3: '#5a965a', // even darker green
        menuIconURI: menuIconURI,
        blocks: [
          {
            opcode: 'pickRandomSeeded',
            blockType: Scratch.BlockType.REPORTER,
            text: 'pick random [MIN] to [MAX] with seed [SEED]',
            arguments: {
              MIN: { type: Scratch.ArgumentType.NUMBER, defaultValue: 1 },
              MAX: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              SEED: { type: Scratch.ArgumentType.STRING, defaultValue: 'my-seed' }
            }
          }
        ]
      };
    }

    pickRandomSeeded(args) {
      let a = toNum(args.MIN, 0);
      let b = toNum(args.MAX, 1);
      const seed = args.SEED ?? '';

      if (a === b) return a;
      if (a > b) { const tmp = a; a = b; b = tmp; }

      const rng = makeRngFromSeed(`${seed}::${a},${b}`);

      if (isInt(a) && isInt(b)) {
        const span = b - a + 1;
        return a + Math.floor(rng() * span);
      }
      return a + rng() * (b - a);
    }
  }

  Scratch.extensions.register(new SeededRandomExtension());
})(Scratch);
